nakan&nbsp;OS&nbsp;Linux</p>','2024-05-24','002 - Backend Developer','2024-05-21 09:52:50.517865',1,'Developer',1,5),(27,'2024-05-21 10:07:11.555304','<p><strong>Requirement :</strong>&nbsp;</p><ul><li>Minimal 2 years experience as System Analyst / Designer / Engineer&nbsp;</li><li>Excellent knowledge in Software Development Life Cycle (SDLC) process&nbsp;</li><li>Good experience in Entity Relational Database (ERD) design&nbsp;</li><li>Familiar with prototyping tools such as Figma, Balsamiq or Adobe XD&nbsp;</li><li>Capable to perform user story interview and task delegation for software development&nbsp;</li></ul>','2024-05-23','003 - System Analyst','2024-05-21 10:07:11.555313',1,'System Analyst',1,6),(28,'2024-05-21 10:09:27.646704','<p><strong>Requirements:</strong></p><p>- Create technical documentation for application needs (e.g. BRD, FSD, TSD/TDD, SIT Script &amp; Result, UAT Script &amp; Result, User Manual/User Guide, etc.)</p><p>- Ensure application quality, timely delivery, and attention to detail in the report, whether it is ad-hoc report or periodic report.</p><p>- Collaborate with Business Analyst, developers and other related teams to identify all documentation repositories, revise and edit, and determine the best solution for centralized data compilation and documentation</p><p>- Establish and evolve formal QA processes, ensuring the team uses industry-accepted best practices.</p><p>- Oversee all aspects of quality assurance, including establishing metrics, applying industry best practices, and developing new tools and processes to meet quality goals.</p><p>- Act as the crucial point of contact for all QA aspects of releases</p><p>-Develop and execute test cases, scripts, plans, and procedures (manual and automated).&nbsp;</p><p>- Ensure focusing on automation along with manual testing</p>','2024-05-23','004 - Quality Assurance','2024-05-21 10:09:27.646714',1,'Quality Assurance',2,3),(29,'2024-05-21 10:11:27.235862','<p><strong>Requirements</strong><